import FilteredList from './FilteredList.js'
import './App.css'

function App() {
  const productList = [
    { id: 1, name: "Steak", size: "Medium", type: "Meat", price: 14.99},
    { id: 2, name: "Steak", size: "Large", type: "Meat", price: 24.99},
    { id: 3, name: "Chicken Breast", size: "Large", type: "Meat", price: 15.23},
    { id: 4, name: "Pork Chop", size: "Medium", type: "Meat", price: 12.52},
    { id: 5, name: "Italian Sausage", size: "Medium", type: "Meat", price: 9.99},
    { id: 6, name: "Broccoli", size: "Medium", type: "Veggie", price: 3.99},
    { id: 7, name: "Cauliflower", size: "Large", type: "Veggie", price: 5.22},
    { id: 8, name: "Carrots", size: "Medium", type: "Veggie", price: 2.22},
    { id: 9, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 10, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 11, name: "Cute Plant", size: "Medium", type: "Veggie", price: 3.99},
    { id: 12, name: "Cute Plant", size: "Large", type: "Meat", price: 3.99}
   ]   
  return (
    <div>
      <h1>CS1300 Food Emporium</h1>
      <FilteredList list={productList} />
    </div>

  );
}

export default App;
